#include <iostream>
#include <vector>
using namespace std;
class Solution
{
public:
    vector<int> twoSum(vector<int> &numbers, int target)
    {   
        bool pairfound = false;
        vector<int> ans{};
        int front=0, rear=numbers.size()-1;
        while(front<rear){
            if(numbers[front]+numbers[rear]==target){
                ans.push_back(front+1);
                ans.push_back(rear+1);
                break;
            }
            if(numbers[front]+numbers[rear]>target){
                rear--;
            }
            else{
                front++;
            }
        }
        return ans;
    }
};

